import './App.css'

export default class Nav extends Component {
    render() {
        return(
            <nav className='navBar'>
                <ul>
                    <li><a hrerf="#">Home</a></li>
                    <li><a hrerf="#">About</a></li>
                    <li><a hrerf="#">Products</a></li>
                    <li><a hrerf="#">Contact</a></li>
                </ul>
            </nav>
        );
    }
}
